const root = createRoot(rootElement);

root.render(
  <StrictMode>
    <div className="App">
      <Cities cityName = "New York"/>
      <Condition description = "Windy" degrees = "17" degreesHL = "9/2"/>

    </div>
  </StrictMode>
);
